import React from 'react'


function Contact() {
  return (
    <section id='contact' className='flex flex-col justify-center md:flex-row px-3 py-32  bg-blue-900 font-HERO text-black  '>
<div className='flex flex-col items-center'>
         <h1 className='text-white font-bold text-7xl border-b-4 w-[240px]'>contact</h1>
<p className='text-white text-3xl'>if you want to discuss more in details,please contact me </p><br/>
<a href='surendhar'></a>
      </div>

</section>

)
}

export default Contact
